import React from 'react';
import Checkbox from '@mui/material/Checkbox';
const App = ()=>{
  const label = { inputProps: { 'aria-label': 'Checkbox demo' } };
  return (
    <>
    
      <Checkbox {...label} defaultChecked />
      <Checkbox {...label} />
      <Checkbox {...label} disabled />
      <Checkbox {...label} disabled checked />
    
    </>
  )
}

export default App;
